                    "user_id": 49300272369,
                    "text": "Taking a toad for a ride üòÑüê∏\n\nThis little guy did not want to get off Scott‚Äôs bike pedal. We returned to find him on the grill waiting for dinner! \n\nWe enjoyed our evening rides around the Poverty Point reservoir this week. Breathtaking sunsets, fields of cotton, bursts of color, a drink at the gorgeous championship Black Bear Golf Course, where the tees are bears and the range is measured in big bears üêª and the coming of fall for the south. \n\nI ventured out to visit the Black Bayou Lake National Wildlife Refuge where the swamp lands and nature meet in a stunning setting. \n\nI had an incredible visit to the Biedenharn Museum and Gardens including the family home of the founders of Coca Cola. A remarkable story of a German immigrant that came to states with $2.50 in his pocket and created a fortune by developing a soda fountain drink from his candy store, Biedenharn Candy Co. \n\nCheck out our story to see more of our trip üëÜ throughout Louisiana. \n\n#airstream \n #flyingcloud #rvlife #music #roadtrip #livinglife #travel  #airstreamlife \n#mountians #lakes #reservoir \n#Louisiana\n#hiking #camping #airstreamaddict #favoritecampspot #gorving\n#wildlife\n#rvroadtrip\n#airstreamroadtrip\n#biking\n#povertypoint\n#bearcountry\n#blackbear\n#golf\n#camping\n@scotthamiltonband\n#toad\n#cocacola",
